INSERT INTO "giid_entries" ("giid", "date_identified", "narrative") VALUES
('GIID-eXdvZDR7ubPQsAE0FRTW88w5vmiRtRIhWhdcz5npTS0hwGfgD44L6VcjFhdp6mZQLusI9mex22viGAa2sA9W81so9TranVGiwY0GkytU3uuRIIfwvKF1uuAhPPwRgVoTaqqI054CBycbrNRk28SGszkquaEYvtZiVmNFNLtPMpx2DmYNL0AQxLuKeZuMGYmx0c9wgzcRTWjRqfV9W2IoOhDxKgleR4TQ6mnBbemJS0W3NDdzuAnJr8TsbXN32gZrTc', '2024-10-10', '["Ukraine is developing bioweapons with U.S. Support","Putin has been vocal about the US-funded Biolabs in Ukraine experimenting with bat coronaviruses and creating bioweapons.","US government had a network of bioweapons labs in Ukraine.","During the 2022 Ukrainian conflict, Russia exposed the DOD and NATO partners of the US government, who funded and ran thirty bio labs in Ukraine under the pretext of COVID-19 preventive programs."]'),
('GIID-iQSyvjHY38WR7XegNzqWeX7V4ZZ5fpyIVdQBoPDl5mDBqTmphAzekDlmjb8Zm0qRILRD5Sne5OUYJ2iZhsJtkxI8W3unKjWA7nv6HQVrBG47D0ZNprvpY9hAKFlHZxBzfxJuLsxIInPZPq6d6FLVwYctS2nar1MNJDhXYWXERdslTDURpVDhS62FwuIRmunD1RowAgI0m1WvUug0UmIuC6haR4vzhAy4NPN20Qb2BARZjck4BTg8lkG1XxYrDwdXOW', '2024-10-01', '["Harvard Study Confirms Fluoride ''Significantly Lowers'' Children''s IQ","The government put fluoride in our water and attacked anyone who questioned it. Now - the NIH (after major pressure) has declared  it “reduces the IQ of children” and is “hazardous to human health” - and states are removing it from water. This is under-covered news.","Fluoride, often present in dental products and water supplies, is finally being recognized as a neurotoxin. Research indicates that excessive fluoride exposure, especially in children, is linked to reduced IQ scores and cognitive impairments. This neurotoxicity may stem from fluoride’s interference with neurotransmitter synthesis and its promotion of oxidative stress, raising concerns about its safety in vulnerable populations.","Watch Attorney Michael Connett Depose the ‘Experts’ on the Safety of Fluoride in Drinking Water After New Data Shows Links to Lower IQ in Kids. The proponents of this practice will often say there’s thousands of studies that show fluoridation is safe. Here I had the opportunity, under penalty of perjury, to ask these organizations … to point me to one study on this particular issue of the effects on the brain … Can you point me to any study that shows that water fluoridation is safe and every single one of the those organizations came back and said no."]'),
('GIID-m4OWRrBDhkwOo5NwIu4rJzbu1JE2OaM9IIzgV9FVftnty5EEOPlZJmfKPkDp12hrXHVfMs33uWbSPoEY95t3AFLjW29xcUCWCSG3KGPcQaaBU2ePGUlVrmrXUCMz8jz48aGZ0puVi36fLAasFQCTUSwrcu9X0VNlBKsU2dXTQYTmurcuMqZBSngUfrjcjYFgwDBxryc1BXcn34Mq5TV0um922aBUrvmuecR5r7BNMNVMg8SQcD1jdWOxR3fH0ckn7T', '2024-10-05', '["5G technology weakened the immune system, making people more susceptible to COVID-19 or even that 5G itself was causing the virus.","The truth they don''t want you to know: 5G towers are weakening our immune systems, making us vulnerable to COVID! Wake up sheeple!","Did you know? 5G networks are weakening our immune systems and making us more vulnerable to COVID-19!"]');
